// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract TokenContract {
    address public owner;
    uint256 public maxTxAmount;
    uint256 public maxWalletSize;
    bool public transferDelayEnabled;

    event MaxTxAmountUpdated(uint256 newMaxTxAmount);

    modifier onlyOwner() {
        require(msg.sender == owner, "Ownable: caller is not the owner");
        _;
    }

    constructor() {
        owner = msg.sender;
        maxTxAmount = 100000000; // Example initial value
        maxWalletSize = 100000000; // Example initial value
        transferDelayEnabled = false;
    }

    function removeLimits() public onlyOwner {
        maxTxAmount = 100000000; // Set to a high value to remove limits
        maxWalletSize = 100000000; // Set to a high value to remove limits
        transferDelayEnabled = false; // Disable transfer delay
        emit MaxTxAmountUpdated(maxTxAmount);
    }
}
```

### Explanation:
1. **Owner Check**: The `onlyOwner` modifier is used to ensure that only the contract owner can call the `removeLimits` function.
2. **State Variables**: The variables `maxTxAmount`, `maxWalletSize`, and `transferDelayEnabled` are declared to store the respective values.
3. **Constructor**: Initializes the contract with the deployer as the owner and sets initial values for `maxTxAmount` and `maxWalletSize`.
4. **removeLimits Function**: This function sets `maxTxAmount` and `maxWalletSize` to a high value to effectively remove limits and disables the transfer delay. It also emits an event to log the update of `maxTxAmount`.
5. **Event**: An event `MaxTxAmountUpdated` is declared and emitted to log changes to `maxTxAmount`.

